import PropTypes from 'prop-types';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import ListItemText from '@material-ui/core/ListItemText';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import { Link } from 'react-router-dom';
import ListItem from '@material-ui/core/ListItem';

const useStyles = makeStyles({
    typography: {
        padding: '1px',
        marginBottom: '7px',
    },
    ul: {
        padding: '0',
    },
});

function SearchInfo({ data, link }) {
    const classes = useStyles();
    
    return (
        <>
            {data.length
                ? (
                    <Paper elevation={2}  >
                        <Box component="div" display="flex" m={5} >
                            <ul className={classes.ul} style={{ 'list-style-type': 'none' }}>
                                {data.map(({ id, name }) =>
                                    <Link to={`/${link}/${id}`} style={{ textDecoration: 'none', color: 'inherit' }}>
                                        <li key={id} className={classes.typography}>
                                            <span>{name}</span>
                                            <Divider />
                                        </li>
                                    </Link>
                                )}
                            </ul>
                        </Box>
                    </Paper>
                )
                : <h1>No results</h1>
            }
        </>
    );
}



export default SearchInfo;
